window.bookSummaryJSON = "<p><b>I was hidden—until he found me.</b></p> <p>For years, I have been living in secret, in a safe haven called Eridian for wolves and others alike inside The Deadlands. Hiding from the Highers' laws and the eyes of the Elites, the Highers' weapon, I make sure we survive the best we can while we live our simple lives.</p> <p>When we collected a female in need to bring her back to Eridian, it was supposed to go as planned, like any other time.</p> <p>And it did until a letter changed it all.</p> <p>As Alpha of Eridian, I have to keep our home a secret and my pack safe at any cost. Even if the cost is me.</p> <p>With beasts plaguing Vrohkaria, the threat of Eridian being discovered, and being brought to the Highers for the crimes we have committed…</p> <p>We may all fall, and there's no one to catch us. Especially not the Alpha of the Elites, who may be my downfall and the greatest danger to my heart.</p> <p><i>This is the first book in The Hidden of Vrohkaria series and ends on a cliffhanger. This is a first-person, MF, spicy, enemies-to-lovers dark fantasy romance for mature listeners.</i></p>"; 
